import React from 'react';

const PrintQuote = (props) => {
    const quo=props.quotes[Math.floor(Math.random()*props.quotes.length)];
    return (
        <div className="printQuote">
            <q>{quo.text}</q>
        </div>
    )
}

export default PrintQuote;
